(function() {
  var app = angular.module('GemStore', ['StoreDirectives']);
})();
(function() {
  var app = angular.module('GemStore');

  app.controller('ReviewController', ['$scope', function($scope) {
    $scope.review = {};

    $scope.addReview = function(product) {
      product.reviews.push($scope.review);

      $scope.review = {};
    };
  }]);
})();
(function() {
  var app = angular.module('GemStore');

  app.controller('StoreController', ['$http', '$scope', function($http, $scope) {
    $scope.products = [];

    $http.get('/products.json').success(function(data) {
      $scope.products = data;
    });
  }]);
})();
(function() {
  var app = angular.module('StoreDirectives', []);

  app.directive("productDescription", function() {
    return {
      restrict: 'E',
      templateUrl: "/gem_store_app/views/products/product-specs.html"
    };
  });

  app.directive("productReviews", function() {
    return {
      restrict: 'E',
      templateUrl: "/gem_store_app/views/products/product-reviews.html"
    };
  });

  app.directive("productSpecs", function() {
    return {
      restrict:"A",
      templateUrl: "/gem_store_app/views/products/product-specs.html"
    };
  });

  app.directive("productTabs", function() {
    return {
      restrict: "E",
      templateUrl: "/gem_store_app/views/products/product-specs.html",
      controller: function() {
        this.tab = 1;

        this.isSet = function(checkTab) {
          return this.tab === checkTab;
        };

        this.setTab = function(activeTab) {
          this.tab = activeTab;
        };
      },
      controllerAs: "tab"
    };
  });

  app.directive("productGallery", function() {
    return {
      restrict: "E",
      templateUrl: "/gem_store_app/views/products/product-specs.html",
      controller: function() {
        this.current = 0;
        this.setCurrent = function(imageNumber){
          this.current = imageNumber || 0;
        };
      },
      controllerAs: "gallery"
    };
  });
})();
